import React, { Component } from 'react';
import { Menu } from 'antd';
import { PlusOutlined } from '@ant-design/icons';
import {
	DiagramWidget,
	DiagramEngine,
	DefaultNodeFactory,
	DefaultLinkFactory,
	DefaultNodeModel,
	DefaultPortModel
} from 'storm-react-diagrams';
import TrayWidget from './graph/component/TrayWidget';
import TrayItemWidget from './graph/component/TrayItemWidget';
import './graph/srd.css';
require("storm-react-diagrams/dist/style.min.css");

const { SubMenu } = Menu;

export default class Toolbar extends Component {
  componentWillMount() {
		this.engine = new DiagramEngine();
		this.engine.registerNodeFactory(new DefaultNodeFactory());
		this.engine.registerLinkFactory(new DefaultLinkFactory());
  }

  handleClick = e => {
    console.log('click ', e);
  };

  render() {
    return (
      <Menu
        onClick={this.handleClick}
        style={{ width: 256 }}
        defaultSelectedKeys={['1']}
        defaultOpenKeys={['sub1']}
        mode="inline"
      >
        <SubMenu
          key="sub1"
          title={
            <span>
              <PlusOutlined />
              <span>Add New Class</span>
            </span>
          }
        >

            <Menu.Item key="1"><TrayItemWidget model={{ type: 'in' , color: "peru", name:"Concept" }} name="Concept" color="peru" /></Menu.Item>
            <Menu.Item key="2">Asset</Menu.Item>
            <Menu.Item key="3">Participant</Menu.Item>
            <Menu.Item key="4">Transaction</Menu.Item>
            <Menu.Item key="5">Event</Menu.Item>
            <Menu.Item key="6">Enumeration</Menu.Item>


        </SubMenu>
        <SubMenu
          key="sub2"
          title={
            <span>
              <PlusOutlined />
              <span>Toolbox</span>
            </span>
          }
        >
          <Menu.Item key="7">Add a Field</Menu.Item>
          <Menu.Item key="8">Add a relation</Menu.Item>

        </SubMenu>

      </Menu>
    );
  }
}
